const tasks = [
  {
    id: 1,
    text: 'A',
    day: '2020-01-25',
    reminder: true,
  },
  {
    id: 2,
    text: 'B',
    day: '2020-05-25',
    reminder: false,
  },
  {
    id: 3,
    text: 'C',
    day: '2019-05-25',
    reminder: false,
  },
]
const Tasks = () => {
  return (
    <div>
      {tasks.map((task) => (
        <h3>{task.text}</h3>
      ))}
    </div>
  )
}

export default Tasks
